import React from 'react'
import { Pie, PieChart, Tooltip } from 'recharts'
import Gender from './Gender';
function Barchart() {
   
  {
    const data = [
      {name: "Male",value:10},
      {name:"Female",value:15},
      {name:"Required",value:3},
    ];
    return(
      <div className='chart'>
    <h1>Genderchart</h1>
    <PieChart width={700} height={900}>
    <Pie
    dataKey="value"
    data={data}
    cx={100}
    cy={150}
    outerRadius={150}
    fill='orange'
    label/>
    <Tooltip/>
    </PieChart>
      </div>
    )
  }
}


export default Barchart
